    value: In response to your letter
  - value: ' please note that our programming errors have been corrected as we have
      discussed with you.  Line 18 entries itemized on Schedule H3 now reflects the
      correct transcations.  Disbursements for Production refer to generic media and
      mail production and are not related to any specific candidate.  The programmiong
      corrections have now allowed for the correct reporting of the in-kind contributions
      as directed by the Commission.The additional activity shown on the amendment
      dated 7/11/02 were left off of the original report due to a software error in
      apply date.  This error occured only in the elctronic filing and it appeared
      to have been reported in our summary pages when the original report was filed.  This
      error was found in July.  The software logic was corrected and the report was
      amended.  If you have any questions'
  - value: ' please contact me at 202/479-7042.'
  expected_count: 4
  input: TEXT,F3XA,,"In response to your letter, please note that our programming
    errors have been corrected as we have discussed with you.  Line 18 entries itemized
    on Schedule H3 now reflects the correct transcations.  Disbursements for Production
    refer to generic media and mail production and are not related to any specific
    candidate.  The programmiong corrections have now allowed for the correct reporting
    of the in-kind contributions as directed by the Commission.The additional activity
    shown on the amendment dated 7/11/02 were left off of the original report due
    to a software error in apply date.  This error occured only in the elctronic filing
    and it appeared to have been reported in our summary pages when the original report
    was filed.  This error was found in July.  The software logic was corrected and
    the report was amended.  If you have any questions, please contact me at 202/479-7042."
